サービス利用規約への同意

提供者：エゴイド（Egoid）
本サービスはビ臨床の自己理解・キャリア探索用であり、医療・診断・治療・カウンセリングの代替ではありません。

第1条（適用・合意）
利用者は本規約及び関連法令を遵守します。14歳未満は法定代理人の同意が必要です。

第2条（アカウント・通知）
重要なお知らせ、決済・返金処理、レポート送付のため、登録メールアドレスを使用します。

第3条（サービス内容）
アンケート/テストの回答に基づき、要約・分析レポート等を提供します。意思決定の最終責任は利用者にあります。

第4条（有料サービス・提供方法）
有料レポートは入金確認後、1–2営業日以内にメールで提供します（提供方式は画面告知に従います）。

第5条（取消・返金）
レポート送付前は全額返金。送付後は電子コンテンツの特性上、撤回が制限される場合があります（制限理由を事前明示）。当社都合の未提供・遅延は全額返金。

第6条（知的財産）
本サービス及びレポート、設問等の著作権その他の権利は当社に帰属。個人的・非商用の範囲を超える複製・配布・送信・リバースエンジニアリング・二次的著作は禁止。

第7条（禁止行為）
他人の情報の不正使用、自動化手段によるデータ収集、レポートの転売・共有その他の不正行為を禁じます。

第8条（変更・中断）
サービスの全部又は一部を変更・中断することがあります。重要な変更は事前告知し、著しい不利益が生じる場合は相当範囲で補償又は返金します。

第9条（責任制限）
当社の故意・重過失がない限り、間接・特別・結果損害等の責任を負いません。責任が認められる場合でも、直近3か月に利用者が当社に支払った有料代金の合計を上限とします（個人情報保護に関する責任は法令に従います）。

第10条（準拠法・管轄）
本規約は大韓民国法を準拠法とし、ソウル中央地方裁判所を専属的合意管轄とします。
※ただし、日本の強行法規（消費者契約法等）の適用を妨げるものではありません。

